u043e\u0434\">1894 \u0433\u043e\u0434\u0430<\/a> \u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043b\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B5_%D0%B0%D1%80%D1%82%D0%B8%D0%BB%D0%BB%D0%B5%D1%80%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B5_%D1%83%D1%87%D0%B8%D0%BB%D0%B8%D1%89%D0%B5\" title=\"\u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u0432\u0441\u043a\u043e\u0435 \u0430\u0440\u0442\u0438\u043b\u043b\u0435\u0440\u0438\u0439\u0441\u043a\u043e\u0435 \u0443\u0447\u0438\u043b\u0438\u0449\u0435\">\u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u0432\u0441\u043a\u0438\u043c \u0430\u0440\u0442\u0438\u043b\u043b\u0435\u0440\u0438\u0439\u0441\u043a\u0438\u043c \u0443\u0447\u0438\u043b\u0438\u0449\u0435\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1812_%D0%B3%D0%BE%D0%B4\" title=\"1812 \u0433\u043e\u0434\">1812<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B8%D0%B9_%D1%87%D0%B5%D1%82%D0%B2%D0%B5%D1%80%D0%B3\" title=\"\u0412\u0435\u043b\u0438\u043a\u0438\u0439 \u0447\u0435\u0442\u0432\u0435\u0440\u0433\">\u0412\u0435\u043b\u0438\u043a\u0438\u0439 \u0447\u0435\u0442\u0432\u0435\u0440\u0433<\/a> \u0437\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u0435\u043c \u043d\u0430 90&#160;% \u0440\u0430\u0437\u0440\u0443\u0448\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%B0%D0%BA%D0%B0%D1%81\" title=\"\u041a\u0430\u0440\u0430\u043a\u0430\u0441\">\u041a\u0430\u0440\u0430\u043a\u0430\u0441<\/a>, \u043e\u043a\u043e\u043b\u043e 20 \u0442\u044b\u0441. \u043f\u043e\u0433\u0438\u0431\u0448\u0438\u0445<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1828_%D0%B3%D0%BE%D0%B4\" title=\"1828 \u0433\u043e\u0434\">1828<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D1%83%D0%B1%D0%B5%D1%80%D1%82,_%D0%A4%D1%80%D0%B0