0\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0430 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e\u043c.<\/li><li>\u0412 \u0441\u0432\u044f\u0437\u0438 \u0441 \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_II\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 II\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 II<\/a> \u043f\u0440\u0435\u043f\u043e\u0434\u043e\u0431\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BC%D0%B2%D1%80%D0%BE%D1%81%D0%B8%D0%B9_%D0%9E%D0%BF%D1%82%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9\" title=\"\u0410\u043c\u0432\u0440\u043e\u0441\u0438\u0439 \u041e\u043f\u0442\u0438\u043d\u0441\u043a\u0438\u0439\">\u0410\u043c\u0432\u0440\u043e\u0441\u0438\u0439 \u041e\u043f\u0442\u0438\u043d\u0441\u043a\u0438\u0439<\/a> \u043d\u0430\u043f\u0438\u0441\u0430\u043b \u043f\u043e\u0441\u043b\u0430\u043d\u0438\u0435 \u00ab\u041d\u0438\u0433\u0438\u043b\u0438\u0441\u0442\u044b \u0438 \u0446\u0430\u0440\u0435\u0443\u0431\u0438\u0439\u0446\u044b \u0441\u0443\u0442\u044c \u043f\u0440\u0435\u0434\u0442\u0435\u0447\u0438 \u0430\u043d\u0442\u0438\u0445\u0440\u0438\u0441\u0442\u0430\u00bb .<\/li><\/ul><\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1903\" class=\"mw-redirect\" title=\"1903\">1903<\/a>&#160;\u2014 \u00ab\u0417\u043b\u0430\u0442\u043e\u0443\u0441\u0442\u043e\u0432\u0441\u043a\u0430\u044f \u0431\u043e\u0439\u043d\u044f\u00bb&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D1%81%D1%81%D1%82%D1%80%D0%B5%D0%BB_%D0%B4%D0%B5%D0%BC%D0%BE%D0%BD%D1%81%D1%82%D1%80%D0%B0%D1%86%D0%B8%D0%B8_%D0%B2_%D0%97%D0%BB%D0%B0%D1%82%D0%BE%D1%83%D1%81%D1%82%D0%B5_(1903)\" title=\"\u0420\u0430\u0441\u0441\u0442\u0440\u0435\u043b \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u0438 \u0432 \u0417\u043b\u043